      <li className="nav-item">
        <Link href="/">
          <a style={linkStyle}>Les recettes de Martine</a>
        </Link>
      </li>
      <li className="nav-item">
        <Link href="/about">
          <a style={linkStyle}>Les recettes de Martine</a>
        </Link>
      </li>
    </ul>
  </div>
);

export default Header;
